<style>
    /* Container for the entire login form */
    .login-container {
        max-width: 400px;
        margin: 0 auto;
        padding: 30px;
        background-color: #fff;
        box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.1);
        border-radius: 8px;
        font-family: Arial, sans-serif;
    }

    /* Header section */
    .login-header {
        text-align: center;
        margin-bottom: 20px;
    }

    .login-title {
        font-size: 30px;
        color: #2f8f85; /* Calm greenish tone */
        font-weight: bold;
    }

    .login-subtitle {
        font-size: 16px;
        color: #777;
        margin-top: 10px;
    }

    /* Styling for the form fields */
    .form-group {
        margin-bottom: 20px;
        position: relative;
    }

    .input-text {
        width: 100%;
        padding: 10px;
        margin-top: 5px;
        border: 1px solid #ddd;
        border-radius: 4px;
        font-size: 16px;
    }

        .input-text:focus {
  ");
