            outline: none;
        }

    .fas {
        position: absolute;
        top: 50%;
        transform: translateY(-50%);
        left: 10px;
        color: #2f8f85;
    }

    .form-row-last {
        text-align: center;
    }

    input[type=""submit""] {
        width: 100%;
        padding: 10px;
        background-color: #2f8f85;
        color: white;
        border: none;
        border-radius: 4px;
        font-size: 18px;
        cursor: pointer;
    }

        input[type=""submit""]:hover {
            background-color: #276d63;
        }

    /* Links and additional text */
    .login-link, .forget-password-link {
        text-align: center;
        margin-top: 20px;
    }

    .signup-link, .forgot-link {
        font-size: 14px;
        color: #2f8f85;
        text-decoration: none;
        font-weight: bold;
        transition: color 0.3s ease-in-out;
    }

